Rejected by fe because the request header is too large. I turned off http2 before, and configured the http_max_header_size parameter in fe and it took effect. So when http2 is enabled, which parameter can modify the request header size of the fe service configuration?
@hf200012 

> The size of the uploaded file is controlled by the jetty_server_max_http_post_size parameter. If you are stream load, it is not controlled by this parameter. The stream load is a 307 temporary redirect, which is directly transferred to be.
